  \"2013-03-16T00:20:30.951213\",\n\t\"name\": \"geologic-map-of-the-state-of-hawaii\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This collection of downloadable files and
  web services contain the geologic map information used to publish U.S. Geological
  Survey Open-File Report 2007-1089 (Sherrod and  others, 2007).  This geologic map
  shows the distribution and stratigraphic relation of volcanic, intrusive, and sedimentary
  units emplaced in the past 8  million years across the eight principal islands of
  the Hawaiian archipelago, State of Hawaii, U.S.A. This geologic map is available
  in several formats including: ESRI Service, WMS, geosciml-portrayal WFS, geodatabase
  (native mapinfo files), shapefiles, geodatabase (e00 export files), or as downloadable
  plates (pdfs) from the USGS landing page (see \"USGS Publications - Geologic Map
  of Hawaii and related links\" link on the left side of the page). On the USGS landing
  page, the State's geology is presented on eight full-color map sheets, one for each
  of the major islands. These map sheets can be downloaded in pdf format, ready to
  print. Map scale is 1:100,000 for most of the islands, so that each map is about
  27 inches by 36 inches. The Island of Hawaii, largest of the islands, is depicted
  at a smaller scale, 1:250,000, so that it, too, can be shown on 36-inch-wide paper.
  \ Both the WMS and WFS services and the USGS maps are based on the same dataset
  published by Sherrod, et al 2007, and are distributed by the USGS and University
  of Hawaii.  Services are being provided by the Arizona Geological Survey.\",\n\t\"license_title\":
